import React from 'react'
import { Cookies } from 'react-cookie';
import { Redirect } from 'react-router-dom';
const cookies = new Cookies();
class Userlist extends React.Component{
    constructor(props){
        super(props)
        const GCC=cookies.get('name');
        const token=localStorage.getItem("token")
        let loginn=true
        if(token === null || GCC === null || GCC === ''){
          loginn=false
        }
        this.state={
            loginn:loginn,
            getlist : [],
        }
    }
    componentDidMount(){
        let url="http://localhost:5000/getlist"
        fetch(url)
        .then(response => response.json())
        .then(res => {
            const getlist = res.result;
            console.log(getlist)
            this.setState({ getlist });
        })
     }
    close = ()=>{
        cookies.remove('name');
        localStorage.removeItem("token")
        this.props.history.push('/start');
    }
    render(){
        if(this.state.loginn === false) {
            return <Redirect to="/start" />
        }
        return(
                <div class="container"><br />
                    <button class="btn btn-danger" onClick={this.close}>Close</button>
                    <table class="table table-striped table-bordered" id="example">
                        <thead className="table table-dark">
                            <tr>
                                <th>S.no</th>
                                <th>Name</th>
                                <th>Source</th>
                            </tr>
                        </thead>
                        <tbody className="table table-active">
                           <tr>
                                <td>1</td>
                                <td>wfvcwef</td>
                                <td>2345</td>
                            </tr>
                            {this.state.loginn}
                            { this.state.getlist.map(getlist =>
                            <tr>
                                <td>{getlist.ex_id}</td>
                                <td>{getlist.name}</td>
                                <td>{getlist.contact}</td>
                            </tr>
                            )}
                        </tbody>
                    </table>
                </div>
        );
    }
}
export default Userlist;
